import React from "react";
import ReactDOM from "react-dom";
import "./main.css";
import { Provider } from "react-redux";

class App extends React.Component {
  render() {
    return <Todo />;
  }
}

ReactDOM.render(
  <Provider>
    <App />
  </Provider>,
  document.getElementById("root")
);
